import React from 'react';
import { Container } from 'react-bootstrap'
import Header from './components/Header';
import Footer from './components/Footer';

const  App = () => {
  return (
    <Container>
      <Header />
      <main>
        <h1>Welcome to ProShop!!</h1>
      </main>
      <Footer />
    </Container>
  );
}

export default App;
